import "./navbar.css"
import React from 'react';

import Data from '../cards/data'
import Details from '../cards/details';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";




export default function Navbar() {


  return (



      <Router >
        <Switch>

          <Route path="/home" component={Data}>
            <Data/>
          </Route>


          <Route path="/deatils" >
            <Details />
          </Route>


        </Switch>
      </Router>



  )

}
